from collections import deque


class Solution:
    def updateMatrix(self, matrix):
        distanceMap = [row[:] for row in matrix]

        queue = deque()

        for i in range(len(matrix)):
            for j in range(len(matrix[i])):
                if matrix[i][j] == 1:
                    distanceMap[i][j] = float("inf")
                else:
                    queue.append((i, j))

        dirArr = [[-1, 0], [1, 0], [0, -1], [0, 1]]
        rows = len(matrix)
        cols = len(matrix[0])

        while queue:
            row, col = queue.popleft()

            for i in range(4):
                new_r = row + dirArr[i][0]
                new_c = col + dirArr[i][1]
                if new_r >= 0 and new_c >= 0 and new_r < rows and new_c < cols:
                    if distanceMap[new_r][new_c] > distanceMap[row][col] + 1:
                        distanceMap[new_r][new_c] = distanceMap[row][col] + 1
                        queue.append((new_r, new_c))

        return distanceMap

